import TodoItem from "./TodoItem";

function TodoList({ todos, getAllTodos }) {
  return (
    <div>
      {todos.map((todo) => (
        <TodoItem key={todo.id} todo={todo} getAllTodos={getAllTodos} />
      ))}
    </div>
  );
}

export default TodoList;
